{"type":"vega","aggs":[],"params":{"spec":"{
  "$schema": "https://vega.github.io/schema/vega/v3.0.json",
  "data": [
    {
      "name": "rawData",
      "url": {
        "%context%": true,
        "%timefield%": "createdAt",
        "index": "rcs.transcripts",
        "body": {
          "size": 15,
          "aggs":  {
            "table": {
              "terms": {
                "field": "threadId.keyword"
              },
              "aggs": {
                "table": {
                  "terms": {
                    "field": "createdAt"
                  },
                  "aggs": {
                    "table": {
                       "terms": {
                          "field": "intent.keyword",
                          "missing": "N/A"
                        }
                      }
                    }
                  }
              }
            },
          }
        }
      },
      "format": {
        "property": "aggregations.table.buckets"
      },
      "transform": [
        {
          "type": "formula",
          "index": "idx",
          "expr": "datum.table.buckets[0].table.buckets[0].key",
          "as": "stk1"
        },

        {
          "type": "formula",
          "expr": 'length(datum.table.buckets)>1? datum.table.buckets[1].table.buckets[0].key: "N/A"',
          "as": "stk2"
        },
        {
          "type": "formula",
          "expr": 'length(datum.table.buckets)>2? datum.table.buckets[2].table.buckets[0].key: "N/A"',
          "as": "stk3"
        },
        {
          "type": "formula",
          "expr": "datum.table.buckets[0].table.buckets[0].doc_count",
          "as": "size"
        }
      ]
    },
    {
      "name": "nodes",
      "source": "rawData",
      "transform": [
        {"type": "filter", "expr": "!groupSelector || groupSelector.stk1 == datum.stk1 || groupSelector.stk2 == datum.stk2 || groupSelector.stk3 == datum.stk3"},
        {"type": "formula", "expr": "datum.key", "as": "threadId"},
        {"type": "formula", "expr": "datum.stk1+' '+datum.stk2+' '+datum.stk3", "as": "key"},
        {"type": "fold", "fields": ["stk1", "stk2", "stk3"], "as": ["stack", "grpId"]},
        {"type": "formula", "expr": "datum.stack == 'stk1' ? datum.stk1+datum.stk2 : datum.stack == 'stk2' ? datum.stk2+datum.stk3 : datum.stk3+datum.stk2", "as": "sortField"},
        {"type": "stack", "groupby": ["stack"], "sort": {"field": "sortField", "order": "descending"}, "field": "size"},
        {"type": "formula", "expr": "(datum.y0+datum.y1)/2", "as": "yc"}
      ]
    },
    {
      "name": "groups",
      "source": "nodes",
      "transform": [
        {"type": "aggregate", "groupby": ["stack", "grpId"], "fields": ["size"], "ops": ["sum"], "as": ["total"]},
        {"type": "stack", "groupby": ["stack"], "sort": {"field": "grpId", "order": "descending"}, "field": "total"},
        {"type": "formula", "expr": "scale('y', datum.y0)", "as": "scaledY0"},
        {"type": "formula", "expr": "scale('y', datum.y1)", "as": "scaledY1"},
        {"type": "formula", "expr": "scale('y', datum.y2)", "as": "scaledY2"},
        {"type": "formula", "expr": "datum.stack == 'stk1'", "as": "rightLabel"},
        {"type": "formula", "expr": "datum.total/domain('y')[1]", "as": "percentage"}
      ]
    },
    {"name": "midNodes", "source": "nodes", "transform": [{"type": "filter", "expr": "datum.stack == 'stk2'"}]},
    {"name": "rightNodes", "source": "nodes", "transform": [{"type": "filter", "expr": "datum.stack == 'stk3'"}]},
    {
      "name": "leftnode",
      "source": "nodes",
      "transform": [
        {"type": "filter", "expr": "datum.stack == 'stk1'"},
        {"type": "lookup", "from": "midNodes", "key": "key", "fields": ["key"], "as": ["target"]},
        {
          "type": "linkpath",
          "orient": "horizontal",
          "shape": "diagonal",
          "sourceY": {"expr": "scale('y', datum.yc)"},
          "sourceX": {"expr": "scale('x', 'stk1') + bandwidth('x')"},
          "targetY": {"expr": "scale('y', datum.target.yc)"},
          "targetX": {"expr": "scale('x', 'stk2')"}
        },
        {"type": "formula", "expr": "range('y')[0]-scale('y', datum.size)", "as": "strokeWidth"},
        {"type": "formula", "expr": "datum.size/domain('y')[1]", "as": "percentage"}
      ]
    }
    {
      "name": "midnode",
      "source": "nodes",
      "transform": [
        {"type": "filter", "expr": "datum.stack == 'stk2'"},
        {"type": "lookup", "from": "rightNodes", "key": "key", "fields": ["key"], "as": ["target"]},
        {
          "type": "linkpath",
          "orient": "horizontal",
          "shape": "diagonal",
          "sourceY": {"expr": "scale('y', datum.yc)"},
          "sourceX": {"expr": "scale('x', 'stk2') + bandwidth('x')"},
          "targetY": {"expr": "scale('y', datum.target.yc)"},
          "targetX": {"expr": "scale('x', 'stk3')"}
        },
        {"type": "formula", "expr": "range('y')[0]-scale('y', datum.size)", "as": "strokeWidth"},
        {"type": "formula", "expr": "datum.size/domain('y')[1]", "as": "percentage"}
      ]
    }
  ],
  "scales": [
    {"name": "x", "type": "band", "range": "width", "domain": ["stk1", "stk2", "stk3"], "paddingOuter": 0.05, "paddingInner": 0.95},
    {"name": "y", "type": "linear", "range": "height", "domain": {"data": "nodes", "field": "y1"}},
    {"name": "color", "type": "ordinal", "range": "category", "domain": {"data": "rawData", "fields": ["stk1", "stk2", "stk3"]}},
    {"name": "stackNames", "type": "ordinal", "range": ["First_Message", "Seconed_Message", "Third_Message"], "domain": ["stk1", "stk2", "stk3"]}
  ],
  "axes": [
    {
      "orient": "bottom",
      "scale": "x",
      "encode": {
        "labels": {
          "update": {"text": {"scale": "stackNames", "field": "value"}}
        }
      }
    },
    {"orient": "left", "scale": "y"}
  ],
  "marks": [
    {
      "type": "rect",
      "from": {"data": "nodes"},
      "encode": {
        "enter": {
          "stroke": {"value": "#000"},
          "strokeWidth": {"value": 2},
          "width": {"scale": "x", "band": 1},
          "x": {"scale": "x", "field": "stack"},
          "y": {"field": "y0", "scale": "y"},
          "y2": {"field": "y1", "scale": "y"}
        }
      }
    },
    {
      "type": "path",
      "name": "leftMark",
      "from": {"data": "leftnode"},
      "clip": true,
      "encode": {
        "update": {
          "stroke": [{"test": "groupSelector && groupSelector.stack=='stk1'", "scale": "color", "field": "stk2"}, {"scale": "color", "field": "stk1"}],
          "strokeWidth": {"field": "strokeWidth"},
          "path": {"field": "path"},
          "strokeOpacity": {"signal": "!groupSelector && (groupHover.stk1 == datum.stk1 || groupHover.stk2 == datum.stk2) ? 0.9 : 0.3"},
          "zindex": {"signal": "!groupSelector && (groupHover.stk1 == datum.stk1 || groupHover.stk2 == datum.stk2) ? 1 : 0"},
          "tooltip": {"signal": "datum.threadId  + ' : ' + datum.stk1 + '  ' + datum.stk2 + '    ' + format(datum.size, ',.0f') + '   (' + format(datum.percentage, '.1%') + ')'"}
        },
        "hover": {"strokeOpacity": {"value": 0.75}}
      }
    },
    {
      "type": "path",
      "name": "rightMark",
      "from": {"data": "midnode"},
      "clip": true,
      "encode": {
        "update": {
          "stroke": [{"test": "groupSelector && groupSelector.stack=='stk2'", "scale": "color", "field": "stk3"}, {"scale": "color", "field": "stk2"}],
          "strokeWidth": {"field": "strokeWidth"},
          "path": {"field": "path"},
          "strokeOpacity": {"signal": "!groupSelector && (groupHover.stk2 == datum.stk2 || groupHover.stk3 == datum.stk3) ? 0.9 : 0.3"},
          "zindex": {"signal": "!groupSelector && (groupHover.stk1 == datum.stk1 || groupHover.stk2 == datum.stk2) ? 1 : 0"},
          "tooltip": {"signal": "datum.threadId  + ' : ' + datum.stk2 + '  ' + datum.stk3 + '    ' + format(datum.size, ',.0f') + '   (' + format(datum.percentage, '.1%') + ')'"}
        },
        "hover": {"strokeOpacity": {"value": 0.75}}
      }
    },
    {
      "type": "rect",
      "name": "groupMark",
      "from": {"data": "groups"},
      "encode": {
        "enter": {"fill": {"scale": "color", "field": "grpId"}, "width": {"scale": "x", "band": 1}},
        "update": {
          "x": {"scale": "x", "field": "stack"},
          "y": {"field": "scaledY0"},
          "y2": {"field": "scaledY1"},
          "fillOpacity": {"value": 0.6},
          "tooltip": {"signal": "datum.grpId + ': ' + format(datum.total, ',.0f') + '   (' + format(datum.percentage, '.1%') + ')'"}
        },
        "hover": {"fillOpacity": {"value": 1}}
      }
    },
    {
      "type": "text",
      "from": {"data": "groups"},
      "interactive": false,
      "encode": {
        "update": {
          "x": {"signal": "scale('x', datum.stack) + (datum.rightLabel ? bandwidth('x') + 8 : -8)"},
          "yc": {"signal": "(datum.scaledY0 + datum.scaledY1)/2"},
          "align": {"signal": "datum.rightLabel ? 'left' : 'right'"},
          "baseline": {"value": "middle"},
          "fontWeight": {"value": "bold"},
          "fontSize": {"value": 12},
          "text": {"signal": "abs(datum.scaledY0-datum.scaledY1) > 13 ? datum.grpId : ''"}
        }
      }
    },
    {
      "type": "group",
      "data": [{"name": "dataForShowAll", "values": [{}], "transform": [{"type": "filter", "expr": "groupSelector"}]}],
      "encode": {"enter": {"xc": {"signal": "width/2"}, "y": {"value": 30}, "width": {"value": 80}, "height": {"value": 30}}},
      "marks": [
        {
          "type": "group",
          "name": "groupReset",
          "from": {"data": "dataForShowAll"},
          "encode": {
            "enter": {"cornerRadius": {"value": 6}, "fill": {"value": "#f5f5f5"},"stroke": {"value": "#c1c1c1"},
              "strokeWidth": {"value": 2}, "height": {"field": {"group": "height"}}, "width": {"field": {"group": "width"}}},
            "update": {"opacity": {"value": 1}},
            "hover": {"fill": {"value": 0.7}}
          },
          "marks": [
            {
              "type": "text",
              "interactive": false,
              "encode": {
                "enter": {
                  "xc": {"field": {"group": "width"}, "mult": 0.5},
                  "yc": {"field": {"group": "height"}, "mult": 0.5, "offset": 2},
                  "align": {"value": "center"},
                  "baseline": {"value": "middle"},
                  "text": {"value": "Show All"},
                  "fontSize": {"value": 14},
                  "stroke": {"value": "#ecf0f1"},
                  "fontWeight": {"value": "bold"}
                }
              }
            }
          ]
        }
      ]
    }
  ],
  "signals": [
    {
      "name": "groupHover",
      "value": {},
      "on": [
        {"events": "@groupMark:mouseover", "update": "{stk1:datum.stack=='stk1' && datum.grpId, stk2:datum.stack=='stk2' && datum.grpId, stk3:datum.stack=='stk3' && datum.grpId}"},
        {"events": "mouseout", "update": "{}"}
      ]
    },
    {
      "name": "groupSelector",
      "value": false,
      "on": [
        {"events": "@groupMark:click!", "update": "{stack:datum.stack, stk1:datum.stack=='stk1' && datum.grpId, stk2:datum.stack=='stk2' && datum.grpId, stk3:datum.stack=='stk3' && datum.grpId}"},
        {"events": [{"type": "click", "markname": "groupReset"}, {"type": "dblclick"}], "update": "false"}
      ]
    }
  ]
}"},"title":"vegaSankey- beta test"}
